import React from 'react';
import {CardList} from './components/card-list/card-list.component'
import './App.css';

class App extends React.Component{
  constructor(){
    super();
    this.state = {
      projects: [
        {
          name: 'Corona Test',
          id: 'pr1',
          url: `https://duexpress.in/wp-content/uploads/2020/05/960x0.jpg`
        },
        {
          name: 'Simple Weather',
          id: 'pr2',
          url: `https://raw.githubusercontent.com/RohanLodhi/weather/d8690115ecb8cdd7a473e5031bd75f125bbb4fdc/imgs/night.svg`
        },
        {
          name: 'Router Library',
          id: 'pr3',
          url: `https://moduscreate.com/wp-content/uploads/2018/04/extjs-react-how-to-configure-routes-00.jpg`
        },
        {
          name: 'Flappy Bird',
          id: 'pr4',
          url: `https://camo.githubusercontent.com/063f3f57c4f5f6986e53f14ee604b1d813a77e19/68747470733a2f2f692e70636d61672e636f6d2f696d61676572792f61727469636c65732f3031456b494f66697367786b666f645a344a6d544958612d312e6669745f7363616c652e73697a655f3236393878313531372e76313536393438393238302e6a7067`
        },
        {
          name: 'ToDo pwa',
          id: 'pr5',
          url: `https://media.istockphoto.com/photos/notepad-open-with-white-blank-page-for-writing-idea-or-todo-list-a-picture-id867672394?k=6&m=867672394&s=612x612&w=0&h=I6aKquFSaiNTdhqjxgcfhRDY5mmaPjU8qnmoCBaVnug=`
        },
        {
          name: 'Portfolio',
          id: 'pr6',
          url: `https://github.com/RohanLodhi/portfolio/blob/master/images/header-bg.jpg?raw=true`
        },
        {
          name: 'Hangman',
          id: 'pr7',
          url: `https://media.istockphoto.com/photos/hangman-sketched-on-blackboard-picture-id466313780?k=6&m=466313780&s=612x612&w=0&h=Wpx_vgPCyt3oEJ5CIAhHxVfWlqdRfXrAfsHX4MbPfe8=`
        }
      ]
    };
  }
  render(){
    return (
      <div className="App">
        <CardList projects={this.state.projects} />
      </div>
    );
  }
}

export default App;
